import { Box, Divider, Paper, Typography } from "@mui/material";
import React from "react";
import TablaPersonas from "./TablaPersonas";
import AlertDialog from "../reusables/AlertDialog"

function SeccionListadoPersonas(props) {
    return (
        <>
            <Paper {...props.paperStyle}>
                <Box sx={{ p: 1 }}>
                    <Typography variant={"h5"}>Personas</Typography>
                    <Divider />
                    <TablaPersonas
                       personas={props.personas}
                        textLabel={props.textLabel}
                    />
                    <AlertDialog
        open={openAlertDialog}
        setOpen={setOpenAlertDialog}
        title={
          `Está por ${logicalDelete ? 'desactivar' : 'eliminar'} al cliente ` +
          formik.values.nombre +
          " " +
          formik.values.apellido
        }
        content={`¿Seguro desea ${logicalDelete ? 'desactivarlo' : 'eliminarlo'}?`}
        buttonTextAccept={logicalDelete ? "Desactivar" : "Borrar"}
        buttonTextDeny="Cancelar"
        buttonActionAccept={deleteCliente}
      >
        <DeleteForeverIcon color="warning" fontSize="medium" />
      </AlertDialog>
                </Box>
            </Paper>
        </>
    );
}

export default SeccionListadoPersonas;
